      "text": "16. Bey hrn. Rudolf Ramsperger an der huth, gasse ist extra guter holländer-Taback in bleyer-nen Pfund-Büchsen à 10 Basen, wie auch guter St. Vincent à 3 ß. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "17. Wo guter Art grosse Bohnen zum Seßen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor-Huth, mittelmäßiger Grösse, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "19. Bey hrn. Burchardt zum Riesen sind extra neue grosse Italiänische Feigen, dito grosse Meertrauben mit und ohne Stiel, Haselnuß, dürre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "20. Zwölf Sack neuer Waissen in billigem Preis, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "21. Bey hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs-Atlas von 63 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jeßigen Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "22. Zwey saubere französische Becher in ein Wirths-haus auf das Land oder in ein Bad dienlich, ohnentgeldtlich im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "23. Eine Behausung in der Aeschsemer Vorstadt mit 4 Stuben, 5 Kammern sammt einer grossen Werkstatt, Estrig und einem schönen ge-wölbten Keller und Garten, weshalb sich bey hrn. Jacob Mäglin dem Weinmann anzu-melden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf-Saamen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbi-gen daher in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küeser zu ver-nehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "26. Circa 6. Saum extra guter alter pur rother Pfälzner Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Bericht-haus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "27. Zwey Stücklein weissen Wein von 1756. à 8 Pfund 10 ß der Saum im einen, und 8 Pfund im andern, wovon nach Belieben zu haben, im Berichtshause ohne Entgeldt zu er-fragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "28. Ein Stock hebt ab 3 Thänen Matten vorm Riechemer-Thor oberhalb der Schorendruck. Ferner ein Stücklein von 5 Saumen rothes Bölliger-Wein von 1760. schön roth und lau-ter, im Berichtshause ohne Entgeldt zu erfra-gen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "29. Auf E. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Im Offenburger-Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "32. Ein Brennhäußlein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piecenweiss wegen Mangel Plazes, wie auch roth und weisser 1753ger Margräser-Wein in billigem Preis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "34. Feine heitergelbe hamburger Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweiss zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "35. Herrn Hofzach des Stegriss Behausung im Spieg-Häslein mit 4 Stuben, 3 Kammern 2c. ist entweder zu verkaufen, oder samethaſt zu verlehién."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "36. Weisse und rothe Margräser-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "37. Ein Männensiſs in St. Peters Kirch auf dem Letner. Item ein grün Tombau-Bethlein mit grünen wollenen Umhängen, in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "38. Ein haussſchlitten mit einem schönen Bild und Zugehördt in billigem Preis, im Bericht-haus zu erfragen."
    },
    {
      "date": null,
